import React, { useState } from "react";

import "./Project.css";
import './style.css';

import { Links } from "./ProjectData";

// import { toggleCategory } from "./Toggles.js";


export default function CurrentLinks() {
  const [currentCat, setCurrentCat] = useState("eat")

  const currentLinks = Links.filter((newProject) => {
    return newProject.category === currentCat;
  });


  return (
    <div className = "content-flex">
        {currentLinks.map(p => (
            <Embed {...p} />
            ))
        } 
    </div>
  );
}
